const PostList = ({posts}) => {
    return ( 
     <div>

       {posts.map(post => (
         <div className='container' key={post.id}>
            <h2>{post.title}</h2>
            <p>{post.description}</p>
         </div> 
       ))}
      </div>
     );
}
 
export default PostList;
